import React from "react";
import { Text, Touchable } from "react-native";

export const ListItems = ({ item }) => {
  return (
    <Touchable>
      <Text style={styles.text}>{item.title}</Text>
    </Touchable>
  );
};

const styles = StyleSheet.create({
  container: {
    paddingTop: 50,
    height: 100,
    backgroundColor: "#f7287b",
  },
  text: {
    color: "white",
    fontSize: 30,
    textAlign: "center",
    fontWeight: "bold",
  },
});
